import{_ as t}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.005-CGRSDkR9.js";import{_ as s}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.007-DUZHqgE5.js";import{_ as o}from"./Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.009-C2z1ACba.js";import{_ as n,c as g,a as r,o as a}from"./app-CUu1n7_5.js";const i="/parts-intellect-docs/assets/Aspose.Words.83ab1c44-6b28-430a-a5f2-4d9e6ba1abd4.003-CGehbX-_.png",p="data:image/png;base64,",e="data:image/png;base64,",m="data:image/png;base64,",l="data:image/png;base64,",c="data:image/png;base64,",V="data:image/png;base64,",E="data:image/png;base64,",U="data:image/png;base64,",I="data:image/png;base64,",B="data:image/png;base64,",d="data:image/png;base64,",w="data:image/png;base64,",b="data:image/png;base64,",C="data:image/png;base64,",v="data:image/png;base64,",G="data:image/png;base64,",K="/parts-intellect-docs/assets/osnovnye_komandy_dlja_raboty_s_zapisjami_v_tablitsah_1-Qi_gbI8t.png",X="data:image/png;base64,",R="data:image/png;base64,",h="data:image/png;base64,",Q="data:image/png;base64,",f="data:image/png;base64,",T={};function q(u,A){return a(),g("div",null,A[0]||(A[0]=[r('<p>В данном разделе будут рассмотрены основные команды, которые присутствуют на панелях инструментов в различных разделах программы: справочниках, списках документов и т.п.</p><p><img src="'+i+'" alt=""></p><ol><li><p><strong>Обновить</strong></p><p><img src="'+t+'" alt=""></p><p>Позволяет обновить данные в таблице.</p></li><li><p><strong>Новый</strong></p><p><img src="'+s+'" alt=""></p><p>Позволяет добавить новую запись в таблицу.</p></li><li><p><strong>Править</strong></p><p><img src="'+o+'" alt=""></p><p>Позволяет открыть страницу редактирования выделенной записи.</p></li><li><p><strong>Действие</strong></p><p><img src="'+p+'" alt=""></p><p>Позволяет выбрать команду действия из выпадающего списка команд:</p><p><img src="'+e+'" alt=""> – команда <strong>Удалить</strong> позволяет пометить на удаление выделенные записи. При удалении запись перестает отображаться в табличной части, но из самой базы данных не удаляется, а только помечается на удаление. Для очистки базы данных от таких записей выполните команду <strong>Удалить помеченные записи</strong> в разделе меню <strong>Управление ► Диагностика программы</strong>.</p><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Просмотр записей помеченных на удаление доступно для пользователя при активной опции <strong>Отображать удаленные элементы</strong> и отключенной опции <strong>Асинхронная загрузка в справочниках и документах</strong> в разделе <strong>Управление ► Настройки программы ► Пользователи ► Настройки пользователя</strong>, вкладка <strong>Разное</strong>.</p></div><p><img src="'+m+'" alt=""> – позволяет изменить отметку документа. Выбор отметок осуществляется из соответствующего справочника. Отметки позволяют отследить в каком статусе на данный момент находится документ;</p><p><img src="'+l+'" alt="">– команда для снятия отметки документа. Отметка присваивается с помощью команды <strong>Изменить отметку</strong>, выбор отметок осуществляется в соответствующем справочнике. Разрешения для снятия отгрузки настраивается в разделе <strong>Управление</strong> <strong>► Настройки программы ► Настройки ►</strong> группа <strong>Склад и закупки ► Движение товара</strong>.</p><p><img src="'+c+'" alt=""> – команда <strong>Переименовать</strong> позволяет открыть выделенную запись для изменения поля <strong>Наименования</strong>;</p><p><img src="'+V+'" alt="">– команда <strong>Копировать</strong> позволяет скопировать выбранную запись.</p></li><li><p><strong>Сменить состояние</strong></p><p><img src="'+E+'" alt=""></p><p>Позволяет выбрать действия из выпадающего списка команд:</p><p><strong>Провести</strong> – позволяет выполнить проведение документа</p><p><strong>Отменить</strong> – позволяет отменить проведение документа</p><p><strong>Добавить в архив</strong> – позволяет переместить документ в <strong>Архив</strong>. Документы <strong>Заказ клиента</strong> помещаются в архив, если в них нет позиций в состояниях, отличных от: <strong>Отказ клиента</strong>, <strong>Расход</strong>, <strong>Возврат клиента</strong> и <strong>Заказ-наряд</strong> (ЗН должен быть в статусе &quot;Закрыт&quot;).</p><p><strong>Извлечь из архива</strong> – позволяет извлечь документ из <strong>Архива</strong>.</p><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Для некоторых документов в пункте <strong>Сменить состояние</strong> содержится перечень состояний документа: <strong>Черновик</strong>, <strong>Отказ клиента</strong>, <strong>В очереди</strong>, <strong>В работе</strong>, <strong>Работы приостановлены</strong>, <strong>Закрыт</strong>. При переводе документов в состояния <strong>В очереди</strong> или <strong>В работе</strong> выполняется проверка на заполнение обязательных полей в соответствии с настройкой <strong>При переводе в очередь или в работу</strong>.</p></div></li><li><p><strong>Принять оплату</strong></p><p><img src="'+U+'" alt=""></p><p>Команда позволяет запустить интерфейс оплаты по выбранному документу для автоматического создания связанных платежных документов и печати чека. Кнопка доступна только для проведенных документов, имеющих задолженность.</p></li><li><p><strong>Создать платеж</strong></p><p><img src="'+I+'" alt=""></p><p>Команда позволяет выбрать из выпадающего списка команду для создания разных типов платежей. Список команд зависит от типа документа, в котором вызывается команда.</p></li><li><p><strong>Создать на основании</strong></p><p><img src="'+B+'" alt=""></p><p>Команда позволяет сформировать новый документы на основании выделенного. При создании документа на основании, в новый документ передаются только те позиции, которые находятся в подходящих состояниях.</p></li><li><p><strong>Импорт</strong></p><p><img src="'+d+'" alt=""></p><p>Команда позволяет загрузить в таблицу (справочник, документы) новые записи из документа.</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Системой поддерживаются следующие форматы файлов для загрузки:Microsoft Excel 95-2003 (*.xls); Microsoft Excel 2007-2013 (*.xlsx, *.xlsm); Файлы dBase (*.dbf); Текстовые файлы с разделителями &quot;точка с запятой&quot;, &quot;запятая&quot;, &quot;табуляция&quot; (*.txt, *.csv).</p></div></li><li><p><strong>Экспорт</strong></p><p><img src="'+w+'" alt=""></p><p>Команда позволяет экспортировать данные из таблицы в файл.</p><p>Документы РН, ВК, ВП, ЗН, Перемещение товара, ПКО, РКО, ПН, ВБК, ОБК в выпадающем меню команды <strong>Экспорт</strong> содержат возможность выгрузки в 1С.</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Системой поддерживаются следующие форматы выгружаемых файлов:Файлы *.csv с разделителями &quot;точка с запятой&quot;, &quot;табуляция&quot;. Microsoft Excel 2007 (*.xlsx); Таблица XML 2003 (*.xml); MS Access (*.mdb).</p></div></li><li><p><strong>Связаться</strong></p><p><img src="'+b+'" alt=""></p><p>Команда позволяет связаться с контрагентом или сотрудником, выбрав команду для связи из выпадающего списка:</p><p><img src="'+C+'" alt="">– по нажатию на команду выполняется звонок выбранному контрагенту/сотруднику на номер, указанный в карточке этого <strong>Контрагента</strong>/ <strong>Сотрудника</strong>;</p><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Команда доступна для пользователей с подключенной IP-телефонией. Для подключения телефонии свяжитесь с менеджерами компании Tradesoft.</p></div><p><strong>Отправить сообщение</strong> – команда для отправки SMS-сообщения выбранному контрагенту на номер телефона, указанный в карточке. По нажатию на команду открывается форма для ввода текста сообщения;</p><p><strong>Отправить</strong> <strong>email</strong> – команда для отправки email выбранному контрагенту на почту, указанную в карточке. По нажатию на команду открывается форма для ввода текста сообщения;</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Для работы сервисов отправки сообщений по email и SMS необходимо активировать соответствующие разрешения в разделе Управление <strong>► Настройки программы ► Настройки ►</strong> группа <strong>CRM ►Уведомления</strong>.</p></div><p><strong>Открыть чат</strong> – команда позволяет открыть чат с клиентами, подписанными на Telegram-бота.</p><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>Для работы сервиса отправки уведомлений и сообщений через Telegram-бот необходимо:▪ подключение дополнительной услуги. За подключением услуги обратитесь в отдел продаж Компании Tradesoft;▪ созданный и настроенный Telegram-бот;▪ установленный и подключенный <strong>Сервер Parts.Intellect</strong>.Подробнее о работе модуля читайте в <a href="https://product-doc.tradesoft.ru/ai/telegram/index.htm" target="_blank" rel="noopener noreferrer">руководстве пользователя</a></p></div></li><li><p><strong>Печать чека</strong></p><p><img src="'+v+'" alt=""></p><p>Команда позволяет вызвать окно печати чека или окно выбора контрагента, для которого будет печататься чек.</p></li><li><p><strong>Печать...</strong></p><p><img src="'+G+'" alt=""></p><p>Команда позволяет сформировать печатные бланки, доступные для конкретного раздела.</p><div class="hint-container note"><p class="hint-container-title">Замечание</p><p>Для документов: <strong>Возвраты от клиентов</strong>, <strong>Приходные накладные</strong> и <strong>Возвраты поставщикам</strong> доступна групповая печать документов.Для вывода печатных форм сразу по нескольким документам необходимо выбрать в списке несколько записей и нажать кнопку <strong>Печать</strong> на панели инструментов. А после этого в окне печати выбрать шаблон и необходимый режим в поле <strong>Печатать</strong>.Доступные значения</p><ul><li><p><strong>Активный документ</strong> – печать по документу, на котором установлен курсор мыши;</p></li><li><p><strong>Выделенные документы с группировкой по документам</strong> – для каждого документа посылаются выбранные бланки по очереди;</p></li><li><p><strong>Выделенные документы с группировкой по шаблонам</strong> – и очередь печати формируется с группировкой по бланкам, а не по документам.</p></li></ul></div><p><img src="'+K+'" alt=""></p></li><li><p><strong>Прочее</strong></p><p><img src="'+X+'" alt=""></p><p>Команда позволяет выбрать необходимое действие из выпадающего списка:</p><p><img src="'+R+'" alt=""> <strong>Добавить в корзину</strong> – команда позволяет добавить выделенные позиции в <strong>Корзину</strong>.</p><p><img src="'+h+'" alt=""> <strong>Навигация по связям</strong> – команда открывает панель с информацией по связанными документами для выделенного (в пункт <strong>Прочее</strong>).</p><p><img src="'+Q+'" alt=""> <strong>Изображения</strong> – команда позволяет увидеть добавленные в программу изображения по позиции.</p><p>Обновить платежи – по нажатию на команду выполняется пересчет балансов клиентов;</p><p>Обновить данные по документу – по нажатию на команду выполняется обновление данных по документу.</p></li><li><p><strong>Помощь</strong></p><p><img src="'+f+'" alt=""></p><p>Позволяет в отдельном окне открыть руководство пользователя. Руководство пользователя откроется на той странице описания разделов программы, с которого было открыто руководство. Например, из раздела <strong>Приходные кассовые ордера</strong> откроется страница с описанием этого раздела.</p><p>В некоторых разделах программы доступен выпадающий список со следующими командами:</p><p><strong>Посмотреть видеоурок</strong> – позволяет открыть видео в браузере с обучением по выбранному разделу;</p><p><strong>Открыть руководство пользователя</strong> – позволяет открыть руководство пользователя.</p></li></ol>',3)]))}const S=n(T,[["render",q]]),J=JSON.parse('{"path":"/specification/obshchie_printsipy/osnovnye_komandy_dlja_raboty_s_zapisjami_v_tablitsah.html","title":"Основные команды для работы с записями в таблицах","lang":"en-US","frontmatter":{"createTime":"2025/04/20 18:24:48","title":"Основные команды для работы с записями в таблицах"},"headers":[],"readingTime":{"minutes":3.67,"words":1101},"git":{"updatedTime":1750007824000,"contributors":[{"name":"a.lutoshkin","username":"","email":"a.lutoshkin@tradesoft.ru","commits":3,"avatar":"https://gravatar.com/avatar/605ee9d365e3a6380f8e9c71f9269ee5373d537aebefbece4e023cac396dfc8d?d=retro"}]},"filePathRelative":"specification/obshchie_printsipy/osnovnye_komandy_dlja_raboty_s_zapisjami_v_tablitsah.md","categoryList":[{"id":"fd8b54","sort":10022,"name":"specification"},{"id":"59b87c","sort":10056,"name":"obshchie_printsipy"}]}');export{S as comp,J as data};
